public extension Link {
    public static func load(_ name: String) -> Link {
        loadTable()
        
        if name.hasSuffix("r") {
            let orig = name.substring(0 ..< name.count - 1)
            return load(orig).reversed
        }
        
        if name.hasSuffix("m") {
            let orig = name.substring(0 ..< name.count - 1)
            return load(orig).mirrored
        }
        
        let code = _table[name]!
        return Link(name: name, planarCode: code)
    }
    
    public static func enumerateKnots(crossing range: CountableClosedRange<Int>) -> [Link] {
        loadTable()
        
        let names = _table.keys.filter { name in
            range.contains{ n in name.hasPrefix("\(n)_") || name.hasPrefix("K\(n)") }
        }
        return names.sorted().map { name in load(name) }
    }
    
    public static func enumerateKnots(crossing n: Int) -> [Link] {
        return enumerateKnots(crossing: n ... n)
    }
    
    public static func enumerateLinks(crossing range: CountableClosedRange<Int>) -> [Link] {
        let names = _table.keys.filter { name in
            range.contains{ n in name.hasPrefix("L\(n)") }
        }
        return names.sorted().map { name in load(name) }
    }
    
    public static func enumerateLinks(crossing n: Int) -> [Link] {
        return enumerateLinks(crossing: n ... n)
    }
}

private typealias CodeTable = [String: Link.PlanarCode]

private func loadTable() {
    if _table.isEmpty {
        _table = CodeTable.loadJSON(_jsonString)!
    }
}

